import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on Subscriptions in the sidebar navigation
    await page.waitForSelector('.nav-item[data-page="subscriptions"]');
    await page.click('.nav-item[data-page="subscriptions"]');
    await page.waitForLoadState('networkidle');

    // Take screenshot after clicking subscriptions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_subscriptions.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_subscriptions.png'));

    // Click on Home to return to the main page
    await page.waitForSelector('.nav-item[data-page="home"]');
    await page.click('.nav-item[data-page="home"]');
    await page.waitForLoadState('networkidle');

    // Take screenshot after returning to home
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_home.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_home.png'));

    return {
      success: true,
      action: "Navigated to subscriptions and returned to home",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

